        const [color, setColor] =  useState("red")
        const [blue, setBlue] = useState(false)

        return (
            <div className='header'>
                    <div>
                        <p className="thing" onClick={() => {
                            if (blue) {
                                setColor("Red")
                            } else {
                                setColor("Blue")
                            }
                            setBlue(!blue)
                        }

                          }>
                            {color}
                        </p>
                    </div>
                    <p className='paragraph'>
                        hello
                    </p>
            </div>
            )
}

export default Navbar
